import React from "react";
import { getMovies } from "../../services/getMovies";

export default function Home() {
  const loadMovies = async () => {
    try {
      const { data } = await getMovies("popular");
      console.log(data);
    } catch (error) {
      console.log(error);
    }
  };

  return <h1>Home</h1>;
}
